import React from 'react';
import { 
  Box, 
  Container, 
  Typography, 
  Grid, 
  Card, 
  CardContent,
  Button,
  useTheme
} from '@mui/material';
import { motion } from 'framer-motion';
import SchoolIcon from '@mui/icons-material/School';
import EventIcon from '@mui/icons-material/Event';
import LibraryBooksIcon from '@mui/icons-material/LibraryBooks';
import { styled } from '@mui/material/styles';

const HeroSection = styled(Box)(({ theme }) => ({
  background: `linear-gradient(45deg, ${theme.palette.primary.main} 30%, ${theme.palette.primary.light} 90%)`,
  color: 'white',
  padding: theme.spacing(15, 0),
  textAlign: 'center',
  position: 'relative',
  overflow: 'hidden',
}));

const FeatureCard = styled(Card)(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'transform 0.3s ease-in-out',
  '&:hover': {
    transform: 'translateY(-10px)',
  },
}));

const StyledIcon = styled(Box)(({ theme }) => ({
  fontSize: '3rem',
  marginBottom: theme.spacing(2),
  color: theme.palette.primary.main,
}));

const Home = () => {
  const theme = useTheme();

  const features = [
    {
      icon: <SchoolIcon fontSize="inherit" />,
      title: 'Excellence in Education',
      description: 'Discover our world-class programs and exceptional faculty dedicated to your success.',
    },
    {
      icon: <EventIcon fontSize="inherit" />,
      title: 'Campus Life',
      description: 'Experience vibrant campus life with diverse events, clubs, and activities.',
    },
    {
      icon: <LibraryBooksIcon fontSize="inherit" />,
      title: 'Research & Innovation',
      description: 'Engage in cutting-edge research and innovative projects that shape the future.',
    },
  ];

  return (
    <Box>
      <HeroSection>
        <Container>
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <Typography variant="h1" gutterBottom>
              Welcome to Our College
            </Typography>
            <Typography variant="h5" sx={{ mb: 4 }}>
              Empowering Minds, Shaping Futures
            </Typography>
            <Button 
              variant="contained" 
              color="secondary" 
              size="large"
              sx={{ 
                px: 4, 
                py: 1.5,
                fontSize: '1.1rem',
                boxShadow: theme.shadows[4],
              }}
            >
              Apply Now
            </Button>
          </motion.div>
        </Container>
      </HeroSection>

      <Container sx={{ py: 8 }}>
        <Grid container spacing={4}>
          {features.map((feature, index) => (
            <Grid item xs={12} md={4} key={index}>
              <motion.div
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, delay: index * 0.2 }}
              >
                <FeatureCard>
                  <CardContent sx={{ textAlign: 'center', flexGrow: 1 }}>
                    <StyledIcon>{feature.icon}</StyledIcon>
                    <Typography variant="h5" gutterBottom>
                      {feature.title}
                    </Typography>
                    <Typography variant="body1" color="text.secondary">
                      {feature.description}
                    </Typography>
                  </CardContent>
                </FeatureCard>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Container>

      <Box sx={{ bgcolor: 'grey.100', py: 8 }}>
        <Container>
          <Grid container spacing={4} alignItems="center">
            <Grid item xs={12} md={6}>
              <Typography variant="h2" gutterBottom>
                Why Choose Us?
              </Typography>
              <Typography variant="body1" paragraph>
                Our college offers a unique blend of academic excellence, innovative research opportunities, 
                and a vibrant campus life that prepares students for success in their chosen fields.
              </Typography>
              <Button 
                variant="contained" 
                color="primary"
                size="large"
              >
                Learn More
              </Button>
            </Grid>
            <Grid item xs={12} md={6}>
              <Box
                component="img"
                src="/campus-life.jpg"
                alt="Campus Life"
                sx={{
                  width: '100%',
                  borderRadius: 2,
                  boxShadow: theme.shadows[4],
                }}
              />
            </Grid>
          </Grid>
        </Container>
      </Box>
    </Box>
  );
};

export default Home;
